const presets = [
  { temp: 100000, coolingRate: 0.9995, baseTile: 'wooden-chest', bpString: '' },
  { temp: 100000, coolingRate: 0.99995, baseTile: 'wooden-chest', bpString: '' },
  { temp: 10000, coolingRate: 0.99995, baseTile: 'wooden-chest', bpString: '' },
  { temp: 10000, coolingRate: 0.99995, baseTile: 'wooden-chest', bpString: '' },
]

function selectPreset(index) {
  let preset = presets[index];
  document.getElementById('initialTemperature').value = preset.temp;
  document.getElementById('coolingRate').value = preset.coolingRate;
  document.getElementById('blueprint-input').value = preset.bpString;
  document.getElementById('base-tile').value = preset.baseTile;
}

module.exports = {
  selectPreset
};